import React from 'react';
import classes from "./Product.module.css";

const Product = ({id, name, sku, price, productType, ...props}) => {
    if(id != null) {
        return (
            <div className={classes.product}>
                <p>{sku}</p>
                <p>{name}</p>
                <p>{price}</p>
                <p>{productType}</p>
            </div>
        );
    }
};

export default Product;
